import React, { Component } from "react";
import Card from "./card";

class HoleCards extends Component {
  render() {
    const { holeCards } = this.props;
    return (
      <div>
        {holeCards.map((holeCard) => (
          <Card src={holeCard.src}></Card>
        ))}
      </div>
    );
  }
}

export default HoleCards;
